import Link from 'next/link';
import './components/design/App.css';

import Header from "./components/layout/Header";


import React from "react";

export default function Index() {
    return (
        <div className="App">
            <Header/>

            <Link href="/about">
                <a>About Page</a>
            </Link>
            <Link href="/statistics">
                <a>Stat</a>
            </Link>
            <p>Hello Next.js</p>

        </div>
    )
}
